import React from "react";
import './completedTask.scss';
import {TaskCompleteTime} from "./TaskCompleteTime";
import {CompletedTaskAlert} from "../AlertComponent/AlertComponent";

export const CompletedTask = ({task,completeTaskThunk}) => {
    console.log('DONETASK_RENDER')
    return(
        <div>
            <div className= {task.completedTask ? `task-item_text text text-width` : `task-item_text text-width` }>
                {!task.completedTask ? <CompletedTaskAlert task={task} completeTaskThunk={completeTaskThunk} classes = {'display-inline_block'}/> : null}
            </div>

            <div>
                <TaskCompleteTime task={task}/>
            </div>
        </div>
    )
}
